import homewebsitephoto1 from "../images/homewebsitephoto1.jpg";
import homewebsitephoto2 from "../images/homewebsitephoto2.jpg";
import homewebsitephoto3 from "../images/homewebsitephoto3.jpg";
import Carousel from 'react-bootstrap/Carousel';
import Card from 'react-bootstrap/Card';
import React from 'react';
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardHeader,
  MDBCardFooter,
  MDBBtn
} from 'mdb-react-ui-kit';


function HomePageCarousel() {
  return (
    <Carousel>
      <Carousel.Item>
        <img
          className="d-block w-100 homephotos"
          src={homewebsitephoto1}
          alt="First slide"
        />
        <Card style={{ width: '18rem' }} className="bg-dark text-white">
        <Carousel.Caption>
          <h3>Photo 1</h3>
          <p className="homephotodesc">Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
        </Card>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100 homephotos"
          src={homewebsitephoto2}
          alt="Second slide"
        />

        <Carousel.Caption>
          <h3>Photo 2</h3>
          <p className="homephotodesc">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100 homephotos"
          src={homewebsitephoto3}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h3>Photo 3</h3>
          <p className="homephotodesc">
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default HomePageCarousel;
